import React from 'react';
import './AuditRiskPanel.css';

/**
 * Audit Risk Panel Component
 * Displays suspicious transaction analysis, red flags, and audit recommendations
 */
const AuditRiskPanel = ({ suspiciousAnalysis, recommendations }) => {
  if (!suspiciousAnalysis) {
    return null;
  }

  const { summary } = suspiciousAnalysis;
  const riskScore = summary?.audit_risk_score || 0;
  const riskLevel = summary?.risk_level || 'CLEAN';
  const flaggedCount = summary?.flagged_count || 0;

  const getRiskColorClass = () => {
    if (riskScore >= 75) return 'risk-critical';
    if (riskScore >= 50) return 'risk-high';
    if (riskScore >= 25) return 'risk-medium';
    if (riskScore > 0) return 'risk-low';
    return 'risk-clean';
  };

  const getRiskIcon = () => {
    if (riskScore >= 75) return 'üö®';
    if (riskScore >= 50) return '‚ö†Ô∏è';
    if (riskScore >= 25) return '‚ö°';
    if (riskScore > 0) return '‚ÑπÔ∏è';
    return '‚úÖ';
  };

  const getPriorityBadgeClass = (priority) => {
    switch (priority?.toUpperCase()) {
      case 'CRITICAL':
        return 'priority-critical';
      case 'HIGH':
        return 'priority-high';
      case 'MEDIUM':
        return 'priority-medium';
      case 'LOW':
      case 'INFO':
        return 'priority-low';
      default:
        return '';
    }
  };

  return (
    <div className="audit-risk-panel">
      <div className="panel-header">
        <h3>üîç Audit Risk Analysis</h3>
        <p className="subtitle">Automated detection of suspicious patterns and SARS audit risks</p>
      </div>

      {/* Risk Score Card */}
      <div className={`risk-score-card ${getRiskColorClass()}`}>
        <div className="risk-score-content">
          <div className="risk-icon">{getRiskIcon()}</div>
          <div className="risk-details">
            <div className="risk-score">{riskScore}/100</div>
            <div className="risk-label">{riskLevel}</div>
          </div>
        </div>
        {flaggedCount > 0 && (
          <div className="flagged-count">
            {flaggedCount} transaction{flaggedCount !== 1 ? 's' : ''} flagged
          </div>
        )}
      </div>

      {/* Summary by Severity */}
      {summary?.by_severity && (
        <div className="severity-breakdown">
          <h4>Issues by Severity</h4>
          <div className="severity-grid">
            {summary.by_severity.CRITICAL > 0 && (
              <div className="severity-item critical">
                <span className="severity-icon">üö®</span>
                <span className="severity-label">Critical</span>
                <span className="severity-count">{summary.by_severity.CRITICAL}</span>
              </div>
            )}
            {summary.by_severity.HIGH > 0 && (
              <div className="severity-item high">
                <span className="severity-icon">‚ö†Ô∏è</span>
                <span className="severity-label">High</span>
                <span className="severity-count">{summary.by_severity.HIGH}</span>
              </div>
            )}
            {summary.by_severity.MEDIUM > 0 && (
              <div className="severity-item medium">
                <span className="severity-icon">‚ö°</span>
                <span className="severity-label">Medium</span>
                <span className="severity-count">{summary.by_severity.MEDIUM}</span>
              </div>
            )}
            {summary.by_severity.LOW > 0 && (
              <div className="severity-item low">
                <span className="severity-icon">‚ÑπÔ∏è</span>
                <span className="severity-label">Low</span>
                <span className="severity-count">{summary.by_severity.LOW}</span>
              </div>
            )}
          </div>
        </div>
      )}

      {/* Summary by Category */}
      {summary?.by_category && (
        <div className="category-breakdown">
          <h4>Issues by Category</h4>
          <div className="category-list">
            {summary.by_category.data_quality > 0 && (
              <div className="category-item">
                <span className="category-icon">üìã</span>
                <span className="category-label">Data Quality</span>
                <span className="category-count">{summary.by_category.data_quality}</span>
              </div>
            )}
            {summary.by_category.fifo_violation > 0 && (
              <div className="category-item">
                <span className="category-icon">‚õî</span>
                <span className="category-label">FIFO Violations</span>
                <span className="category-count">{summary.by_category.fifo_violation}</span>
              </div>
            )}
            {summary.by_category.price_anomaly > 0 && (
              <div className="category-item">
                <span className="category-icon">üí∞</span>
                <span className="category-label">Price Anomalies</span>
                <span className="category-count">{summary.by_category.price_anomaly}</span>
              </div>
            )}
            {summary.by_category.audit_risk > 0 && (
              <div className="category-item">
                <span className="category-icon">üéØ</span>
                <span className="category-label">Audit Risks</span>
                <span className="category-count">{summary.by_category.audit_risk}</span>
              </div>
            )}
          </div>
        </div>
      )}

      {/* Recommendations */}
      {recommendations && recommendations.length > 0 && (
        <div className="recommendations-section">
          <h4>üìå Recommendations</h4>
          <div className="recommendations-list">
            {recommendations.map((rec, index) => (
              <div key={index} className={`recommendation-item ${getPriorityBadgeClass(rec.priority)}`}>
                <div className="recommendation-header">
                  <span className={`priority-badge ${getPriorityBadgeClass(rec.priority)}`}>
                    {rec.priority}
                  </span>
                  <span className="recommendation-issue">{rec.issue}</span>
                  {rec.count > 0 && (
                    <span className="recommendation-count">({rec.count})</span>
                  )}
                </div>
                <div className="recommendation-action">{rec.action}</div>
              </div>
            ))}
          </div>
        </div>
      )}

      {/* Clean Report Message */}
      {flaggedCount === 0 && (
        <div className="clean-report">
          <div className="clean-icon">‚úÖ</div>
          <h4>Clean Report</h4>
          <p>No suspicious patterns detected. Your transaction data appears consistent and compliant.</p>
        </div>
      )}
    </div>
  );
};

export default AuditRiskPanel;
